import numpy as np
import matplotlib.pyplot as plt

r = np.arange(0, 4, 0.01)
theta = 4 * np.pi * r + 10
fig, ax = plt.subplots(
  subplot_kw = {'projection': 'polar'} 
)
ax.plot(theta, r);
ax.set_rticks([0.5, 1, 1.5, 2]);
ax.grid(True);
plt.show()







Figure¬†1: A line plot on a polar axis
